package cn.xgame.config.o;import java.util.Map;import x.javaplus.string.StringUtil;public class StarsPo {	public final int id;	public final String name;	public final String intro;	public final String icon;	public final short level;	public final String goods;	public final byte type;	public final byte belong;	public final int x;	public final int y;	public final int z;	public final String building;	public final short room;	public final String ectypes;	public final byte tavernCapTimes;	public final String neighbor;

	public StarsPo( StarsPo clone ){		this.id = clone.id;		this.name = clone.name;		this.intro = clone.intro;		this.icon = clone.icon;		this.level = clone.level;		this.goods = clone.goods;		this.type = clone.type;		this.belong = clone.belong;		this.x = clone.x;		this.y = clone.y;		this.z = clone.z;		this.building = clone.building;		this.room = clone.room;		this.ectypes = clone.ectypes;		this.tavernCapTimes = clone.tavernCapTimes;		this.neighbor = clone.neighbor;

	}	public StarsPo( Map<String, String> data ){		id = Integer.parseInt( StringUtil.convertNumberString( data.get("id") ) );		name = data.get("name");		intro = data.get("intro");		icon = data.get("icon");		level = Short.parseShort( StringUtil.convertNumberString( data.get("level") ) );		goods = data.get("goods");		type = Byte.parseByte( StringUtil.convertNumberString( data.get("type") ) );		belong = Byte.parseByte( StringUtil.convertNumberString( data.get("belong") ) );		x = Integer.parseInt( StringUtil.convertNumberString( data.get("x") ) );		y = Integer.parseInt( StringUtil.convertNumberString( data.get("y") ) );		z = Integer.parseInt( StringUtil.convertNumberString( data.get("z") ) );		building = data.get("building");		room = Short.parseShort( StringUtil.convertNumberString( data.get("room") ) );		ectypes = data.get("ectypes");		tavernCapTimes = Byte.parseByte( StringUtil.convertNumberString( data.get("tavernCapTimes") ) );		neighbor = data.get("neighbor");

	}}